class user {
  constructor(){
    this.name= 'Name';
    this.age = 'age';
    this.contact= [new contact()];
    this.education=[new education()];
  }
}


class contact{
  constructor(index, name ,link){
    this.index= index;
    this.name = name;
    this.link = link;
  }
}

class education {
  constructor(school, year, field){
    this.school = school;
    this.year = year;
    this.field = field;
  }
}
